    false,nt"url": null,nt"notes": "This dataset contains borehole temperature
    observations compiled by the Mississippi Department of Environmental Quality - Office
    of Geology, and published as a Web feature service for the National Geothermal Data
    System. Fields in the Borehole Temperature Observation Content Model will become
    XML elements in interchange documents for WMS simple features provided by a node
    in the USGIN network. Each feature includes a Well Name, Measured Temperature, Measurement
    Depth, Symbol and Source. The dataset is spatially referenced to EPSG: 4326 (for
    interoperability). The data contained in the submitted dataset is available as an
    Excel Spreadsheet, ESRI service, WMS and WFS service. Link to Borehole Temperature
    Observation Content Model: http://www.stategeothermaldata.org/data_delivery/content_models/borehole_temperature_observation.",nt"license_title":
